import React from 'react';
import ReactWeather from 'react-open-weather';
import { Card } from 'react-bootstrap';

function CurrentWeather(props) {
    const {weather} = props
    return (
        <Card>
            <Card.Body>
                {weather.main}
            </Card.Body>
        </Card>
    );
}

export default CurrentWeather;
